Accounts_CustomFields_Description:
Deve ser um JSON válido onde as chaves são os nomes de campos contendo um dicionário de configuração de campos. Exemplo:<br/><code>{
 "role": {
  "type": "select",
  "defaultValue": "student",
  "options": ["teacher", "student"],
  "required": true,
  "modifyRecordField": {
   "array": true,
   "field": "roles"
  }
 },
 "twitter": {
  "type": "text",
  "required": true,
  "minLength": 2,
  "maxLength": 10
 }
}</code>

Custom_Translations_Description:
Deve ser um JSON válido onde as chaves são idiomas que contêm um dicionário de chave e traduções. Exemplo:<br/><code>{
"en": {
"Channels": "Rooms"
},
"pt": {
"Canais": "Salas"
}
}</code>

SAML_Custom_user_data_fieldmap_descripti:
Configure como campos de conta de usuário (como email) são populados de um registo no SAML (uma vez encontrado). 
Por exemplo, `{"name":"cn", "email":"mail"}` escolherá o nome legível da pessoa do atributo cn attribute, e seu email do atributo mail.
Campos disponíveis no Rocket.Chat: `name`, `email` e `username`, todo o resto será salvo como `customFields`.
Defina o nome de um atributo imutável à chave '__identifier__' para utilizá-lo como identificador de usuário.
Você também pode usar expressões regulares e templates. Templates serão processados primeiro, exceto quando eles fazem referência ao resultado da expressão regular.
```{
  "email": "mail",
  "username": {
    "fieldName": "mail",
    "regex": "(.*)@.+$",
    "template": "user-__regex__"
  },
  "name": {
   "fieldNames": [
      "firstName",
      "lastName"
    ],
    "template": "__firstName__ __lastName__"
  },
  "__identifier__": "uid"
}```
